import React, { Component } from "react";
import "./style.css";

export const Row = props => (
  <>
    <tr>
      <td>
        <img src={props.image} alt={props.name} />
      </td>
      <td>{props.name}</td>
      <td>{props.phone}</td>
      <td>{props.email}</td>
      <td>{props.dob}</td>
    </tr>
  </>
);

class EmployeeTable extends Component {
  render() {
    return (
      <table>
        <tr>
          <th>Image</th>
          <th>Name</th>
          <th>Phone</th>
          <th>Email</th>
          <th>DOB</th>
        </tr>
        {this.state.employees.map(person => (
          <Row {...person} />
        ))}
      </table>
    );
  }
}

export default EmployeeTable;
